import './index.scss'
import AnimatedLetters from '../AnimatedLetters'

const About = () => {

    return (
        <div className='container about-page'>
            <div className='text-zone'>
                <h1>
                    <AnimatedLetters
                        strArray= {['About Me'.split('')]}
                        idx = {15}
                    />
                </h1>
                <p>Hey There, What is UP?</p>
                <p>This is some info about me</p>
                <p>Yeet</p>
            </div>
        </div>
    )
}

export default About
